import React from 'react';
import styled from 'styled-components';

const StyledSlideOne = styled.div`
  position: relative;

  .image-wrapper {
    position: absolute;
    top: 40px;
    right: 80px;
    display: inline-block;
    height: 80vh;

    img {
      height: 100%;
      border: black solid 4px;
      border-radius: 30px;
    }
  }
  .background-top {
    position: relative;
    background: #FAC943;
    width: 100%;
    height: 80vh;
  }
  .background-bottom {
    position: relative;
    background: #FFFFFF;
    width: 100%;
    height: 20vh;
  }
`;

function SlideOne() {
  return (
    <StyledSlideOne>
      <div className='background-top'/>
      <div className='background-bottom' />
      <div className='image-wrapper'>
        <img src='images/app_screen_4.png'/>
      </div>
    </StyledSlideOne>
  );
}

export default SlideOne;
